import React, { Component } from 'react';
import '../App.css';

export class ActCard extends Component{
constructor(props){
    super(props);
}
render() {
    return(
        <div onClick={this.props.onClick} className="card">
            <img className="avatar" src={require('../assets/Bgs/av_st.png')} alt='avatar' />
            <div className="actTypeContainer">
                <h4><b>{props.acteur.type}</b></h4>
            </div>
        </div>
    );
};
}

export default ActCard;
